The Queensland specimens have some minor differences to the specimens from the type locality: the dorsal sculpturing is weaker, there are fewer lateral papillae (ca. 25 vs 50 ) and most ventral, genital and anal setae are shorter. There is a chance that they may represent another species, but because they came from the same host plant, and without an assessment of variation from several populations or genomic analysis, we tentatively consider them the same species. The use of low temperature scanning electron microscopy (LT-SEM) revealed that the specimens from both localities have very similar pattern of “microplate” (sensu
Welbourn et al. 2003
) development on the cuticle (
Fig. 123
).
